import './CustomerFeedbackItem.scss';

function CustomerFeedbackItem({customer, review}) {

    return (
      <div className="customerFeedbackItem">
        <div className="customerFeedbackItem__review">
            <p>{review}</p>
        </div>
        <div className="customerFeedbackItem__customer">
            <p>{customer}</p>
        </div>
      </div>
    );
  }

  export default CustomerFeedbackItem;
